    "EXIST hold LIN book PERS.SUBJ PN",
    "‘Pedro is holding a book’",
    "Non-verbal construction. RG suggested to treat this construction “as similar to AV”. For that reason, ‘Pedro’ is classified as ACT (in fact, one of the linguists RG consulted suggested exactly the contrary, i.e. to treat unconjugated verbs, here and elsewhere, as parallel to PV). Grammatically, “hawak na” is a preposed modifier to “libro” (not unlike adjectives); “One can actually also say “may libro na hawak”, and “na hawak” is a relative clause”. Thus, “libro” has a very special status here in that it has no flag at all (hence, classified as BARE). There is a solid ground to believe that ‘the book’ is not the subject (Cf. RG’s remark that Sabbagh (2009) wrote that “Concretely, all existential sentences are impersonal constructions in that they have no overt subject and the nominal pivot functions as an internal argument of some sort. That the pivot (e.g., held book) is an internal argument rather than a subject is established by a couple of observations. First, one property of subjects in Tagalog is that they can serve as the shared subject of coordinated predicates… By contrast, non-subjects (namely, direct objects and VP-internal agents) cannot serve as the shared argument of coordinated predicates (see Kroeger 1993: 35; Sabbagh 2008)… With respect to this type of argument sharing, the pivot in existential sentences appears to pattern as a non-subject (i.e., internal argument) rather than as a subject.” Alternative is the stative construction with the pattern ACT_UND: “Hawak-hawak ni Pedro ang libro” [held PERS.GEN PN SUBJ book] ‘Pedro is holding the book.’",
